 Create an empty array to store the sorted strings. Loop through the input array and compare each string with the current element of the output array using the `strcmp()` function. If the strings are equal, simply append them to the output array. Otherwise, if the first string is less than the second one (alphabetical order), append it to the output array and decrement the index by 1. This will cause a subsequent comparison with the next element of the input array to be performed. Repeat this process until all strings have been compared.

Here's an example implementation:

```python
def sort_strings(input_array):
    output_array = []

    # Loop through the input array and compare each string with the current element of the output array
    for i in range(len(input_array)):
        if input_array[i] < output_array[-1]:
            output_array.append(input_array[i])
            i -= 1
        else:
            continue

    # If the strings are equal, simply append them to the output array
    for j in range(len(input_array)):
        if input_array[j] == output_array[-1]:
            output_array.append(input_array[j])

    return output_array
```

 // A possible Java code using the bubble sort algorithm for sorting an array of strings in alphabetical order.
// Input is an array of strings. Output is the sorted array of strings.
public static void sortStrings(String[] arr) {
  // Loop through the array from the first element to the second last element
  for (int i = 0; i < arr.length - 1; i++) {
    // Compare each pair of adjacent elements and swap them if they are out of order
    for (int j = i + 1; j < arr.length; j++) {
      // Convert the strings to lower case to ignore case sensitivity
      if (arr[i].toLowerCase() > arr[j].toLowerCase()) {
        String temp = arr[i];
        arr[i] = arr[j];
        arr[j] = temp;
      }
    }
  }
}

