 Here is a simple function to sort an array of strings in alphabetical order using JavaScript as an example:

```javascript
function sortStrings(arr) {
  // Use the built-in sort method with a compare function
  arr.sort((a, b) => {
    // Compare two strings in alphabetical order
    return a < b ? -1 : (a > b ? 1 : 0);
  });
  return arr;
}
```

Usage:

```javascript
const words = ['banana', 'apple', 'orange', 'kiwi'];
sortStrings(words); // ['apple', 'banana', 'kiwi', 'orange']
```
